import React from 'react'

interface TypeScriptOneProps {
    name:string
    age:number
}

export default class TypeScriptOne extends React.Component <TypeScriptOneProps> {
    render() {
        return (`我是${this.props.name},今年${this.props.age}岁了`);
    }

}
